// Dependencies
import React, { Component } from 'react'

class index extends Component {
    render () {
        return (
            <div>
                <header> Podcasts</header>

                <style jsx>
                    {`
                    :global(body) {
                        margin: 0;
                        font-family: system-ui;
                        background: white;
                        text-align: center
                    };
                    
                    header {
                        color: #fff;
                        background: #8756ca;
                        padding: 15px;
                    }
                 `}
                </style>
            </div>
        )
    }
};

export default index
